import React from 'react'
const Salary = ({ salary }) => {
    return (
        <tr>
          <td>{salary.payment_date}</td>
          <td>{salary.amount}</td>
          <td>{salary.description}</td>
          <td><button >Download</button></td>
        </tr>
      )
}
// onClick={() => invoice(salary)}
export default Salary;
